#!/usr/bin/env python3
# -*- coding: utf-8 -*-

import statistics

f = open('data.txt', 'r')
noise_data = f.readlines()

noise_data = [float(x)+0.5 for x in noise_data]
f.close()


for shift in range(10, 10000, 10):
    result_msg =''
    
    for combination in range(0, shift):
        partial_noise_data = [noise_data[x] for x in range(combination,len(noise_data), shift)]
        result_msg += str(int(round(statistics.median(partial_noise_data))))
    
    if 20 * '1' and 30 * '0' in result_msg:
        print(shift, result_msg)
        print(' ')
        
message = ''

short = (10*'1')+(10*'0')
long = (20*'1')+(10*'0')
space = (30*'0')

message2 = message.replace(long, '-')
message2 = message2.replace(short, '.')
message2 = message2.replace(space, ' ')

